 "Typically, Date will be associated with the creation or availability of the resource. Recommended best practice for encoding the date value is defined in a profile called <em>ISO 8601<\/em> <a href=\"\/docs\/W3C-NOTE-datetime.html\" target=\"_blank\">W3C Date and Time Formats<\/a> and includes (among others) dates of the form YYYY-MM-DD.": "Data, normalean, baliabidearen sorrerarekin edo erabilgarritasunarekin lotuta egoten da. Data kodetzeko modurik egokiena, <em>ISO 8601<\/em> izena duen profilean zehaztuta dago <a href=\"\/docs\/W3C-NOTE-datetime.html\" target=\"_blank\">W3C Date and Time Formats<\/a> eta, beste batzuen artean, YYYY-MM-DD formakoak barne ditu.", 
