 "Reflection": "Hausnarketa", 
 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Jarduera zabalgarrietan, ikasleek hitz egokia aukeratu behar dute testua edo esaldiak osatzeko. Ariketa horiek hainbat helburu izaten dituzte:<\/p><ol><li>Ikastaroko oinarrizko kontzeptuak ezagutzen ote diren egiaztatzea (aurrekontrol, trebakuntza ariketa edo froga gehigarri gisa).<\/li><li>Irakurgaia zenbateraino ulertu den frogatzea.<\/li><li>Hiztegia zenbateraino ezagutzen den egiaztatzeko.<\/li><li>Hitz osaketa\/gramatika ziurtatzeko. <\/li><\/ol>", 
 "If you don't choose this option, target field will be empty. Some Computer Aided Translation tools (i.g. OmegaT ) just translate the content of the target field. If you are using this kind of tools, you will need to pre-fill target field with a copy of the source field.": "Aukera hau ez baduzu klikatzen, helburu testua hutsik sortuko da. Itzulpen tresna batzuk (adib.: OmegaT) xede hizkuntzako testuekin lan egiten dute soilik eta jatorrizko eremuaren testuarekin aurre-beteta egotea behar dute.", 
 "Enter the details of the reading including reference details. The \nreferencing style used will depend on the preference of your faculty or \ndepartment.": "Adierazi irakurketaren zehaztasunak, erreferentziak barne. \nErabilitako erreferentziaren estiloa zure fakultatearen edo sailaren \nlehentasunen araberakoa izango da.", 
 "Add a single text line to an iDevice. Useful if you want the ability to place a label within the iDevice.": "Gehitu testu lerro bat iDevice batera. Erabilgarria da iDevice-ren barruan etiketa bat jartzeko.", 
 "---Move To---": "---Ondokora mugitu---", 
 "Unlike the MCQ the SCORM quiz is used to test \nthe learners knowledge on a topic without providing the learner with feedback \nto the correct answer. The quiz will often be given once the learner has had \ntime to learn and practice using the information or skill.\n ": "MCQa ez bezala, SCORM ariketa ikasleei \ninformaziorik eman gabe haien jakintza egiaztatzeko erabiltzen da.\nAriketa hau ikasleek informazioa ikasteko eta\nerabiltzeko denbora izan ondoren egiten da askotan.", 
